pragma solidity ^0.5.0;

import "../roles/Club.sol";
import "../roles/User.sol";


contract Activity {
    address public owner; //
    string public name; //
    string public date; //
    string public locate; //
    string public message; //

    uint8 public state; //0 1 2 3 

    //////////////////////////////////////////////////
    ///////////////////////////////////////////////
    //////////////////////////////////////////////////

    //
    // modifier onlyMember(address addr) {
    //     Club club = Club(owner);
    //     require(club.isMember(addr),"");
    // }

    //
    modifier onlyMember(address addr) {
        bool flag = false;
        for (uint256 i = 0; i < members.length; i++) {
            if (members[i] == addr) {
                flag = true;
            }
        }
        require(flag, "");
        _;
    }

    modifier onlyApplicant(address addr) {
        bool flag = false;
        for (uint256 i = 0; i < applicants.length; i++) {
            if (applicants[i] == addr) {
                flag = true;
            }
        }
        require(flag, "");
        _;
    }

    //////////////////////////////////////////////////
    ///////////////////////////////////////////
    //////////////////////////////////////////////////

    constructor(
        string memory _name,
        string memory _date,
        string memory _locate,
        string memory _message
    ) public {
        owner = msg.sender;
        name = _name;
        date = _date;
        locate = _locate;
        message = _message;
    }

    //////////////////////////////////////////////////
    ///////////////////////////////////////////
    //////////////////////////////////////////////////

    //
    event stateChangeEvent();

    function changeState(uint8 _state) public {
        require(msg.sender == owner, "");
        state = _state;

        emit stateChangeEvent();
    }

    //
    event infoChangeEvent();

    function changeInfo(
        string memory _name,
        string memory _date,
        string memory _locate,
        string memory _message
    ) public {
        //
        require(msg.sender == owner, "");
        name = _name;
        date = _date;
        locate = _locate;
        message = _message;

        emit infoChangeEvent();
    }

    //////////////////////////////////////////////////
    ////////////////////////////////////////
    //////////////////////////////////////////////////
    //
    function getMember()
        public
        view
        onlyMember(msg.sender)
        returns (address[] memory)
    {
        return members;
    }

    //////////////////////////////////////////////////
    ////////////////////////////////////////////
    //////////////////////////////////////////////////

    address[] members; //
    address[] applicants; //

    ///
    event membersChangeEvent();

    function join(address addr) public {
        Club club = Club(owner);
        if (club.isMember(addr)) {
            //
            //
            members.push(addr);
            //user
            User user = User(addr);
            user.actApply();
            user.actPass();

            emit membersChangeEvent();
        } else {
            //
            //
            applicants.push(addr);
            //user
            User user = User(addr);
            user.actApply();

            emit applicantsChangeEvent();
        }
    }

    //
    function getApplies() public view returns (address[] memory) {
        require(msg.sender == owner, "");
        return applicants;
    }

    //
    event applicantsChangeEvent();

    function pass(address addr) public onlyApplicant(addr) {
        require(msg.sender == owner, "");
        for (uint256 i = 0; i < applicants.length; i++) {
            if (applicants[i] == addr) {
                User user = User(addr);
                user.actPass();

                //
                applicants[i] = applicants[applicants.length - 1];
                applicants.pop();
                //
                members.push(addr);

                emit membersChangeEvent();
                emit applicantsChangeEvent();
            }
        }
    }

    //////////////////////////////////////////////////
    //////////////////////////////////////////////
    //////////////////////////////////////////////////

    notification[] notifications; //
    struct notification {
        string title;
        string date; //yyyy-MM-dd-hh-mm-ss
        string info;
    }

    function getNotification(uint256 index)
        public
        view
        onlyMember(msg.sender)
        returns (string memory title, string memory _date, string memory info)
    {
        return (
            notifications[index].title,
            notifications[index].date,
            notifications[index].info
        );
    }

    function getNotifiAmount()
        public
        view
        onlyMember(msg.sender)
        returns (uint256 amount)
    {
        return notifications.length;
    }

    //
    event newMessageEvent(uint256 index);

    function addMessage(
        string memory _title,
        string memory _date,
        string memory _info
    ) public {
        require(msg.sender == owner, "");
        notifications.push(
            notification({title: _title, date: _date, info: _info})
        );

        emit newMessageEvent(notifications.length - 1);
    }
}
